import React from 'react';

import Router from './components/Router';

import routes, { routePath } from './routes';

const navLinks = [
    { text: 'Counter', href: routePath('counter') },
    { text: 'Github Repos', href: routePath('github.repos') }
];

const App = props => (
    <>
        <h1>App</h1>
        <Router routes={routes} />
    </>

);

export default App;
